import React from 'react'
import aboutUsBackground from '../images/aboutusbg.png'

const AboutAndContact = () => {
  return (
    <div className='aboutAndContact' id='aboutAndContact'>
      <img className='aboutUsBackgroundPicture' src={aboutUsBackground} alt='A tennis court surrounded by a circular gradient in the color black'/>
      AboutAndContact
    </div>
  )
}

export default AboutAndContact
